import React from "react";
import { Link} from "react-router-dom";
import report from './ProgressReport/report';
import "./dashboard.css";

const Dashboard = () => {

    const progressData = {
      midTerm: 85,
      finalTerm: 90,
    };
  
  return (
    <div className="main">
        <div className="title">
    <h1>Dashboard</h1>
  </div>

<div className="other">
      <ul>
        <li>
          <Link to="/dashboard/chat">Chat System</Link>
        </li>
        <li>
          <Link to="/dashboard/achievements">Track Achievements</Link>
        </li>
        <li>
          <Link to="/dashboard/progress">View Progress Report</Link>
        </li>
      </ul>
      </div>
      
      <div className="dashboard">
        {/* Other dashboard content */}
        <ProgressReport data={progressData} />
      </div>
  
    </div>
  );
};

export default Dashboard;
